import React from 'react';
import Card from './Card';

const SearchResults = (props) => {
  return (
    <div id="results">
      <h3>Here's what we found ({ props.length }) results)</h3>
      {
          props.map(card => {
              return <Card key={ props.id } {...card} />
          })
      }
    </div>
  );
}

export default SearchResults;
